import React from 'react';
import ProductItem from './ProductItem';

const ProductList = ({items}) => {
    if(items.length === 0){
        return (
            <div className="row center">
                <h4>Can't find any product...</h4>
            </div>
        )
    }
    return (
        <div>
            {items.map(item => {
                <ProductItem id={item.id} {...item}/>
            })}
        </div>
    )
}

export default ProductList;
